class Intro extends Component {
    render() {
        return(
            <Container>
                <Row>
                    <Col sm={8}><div><h1>netflix community</h1></div></Col>
                    <Col sm={4}>
                        <Link to='/login'>login</Link>
                        {/* <Link to='/signup'>signup</Link> */}
                    </Col>
                </Row>
            </Container>
        );
    }
}

export default Intro;
